import React from "react";
import "./Experience.css";
const Experience = () => {


  return (
    <div className="div-exp">
      <span> Experience</span>
    <div className="experience" id='Experience'>
      
    
      
      <div className="achievement">
        <div className="circle" >2MONTHS</div>
        <span ><iconify-icon icon="simple-line-icons:location-pin"></iconify-icon>
 Oujda,Maroc</span>
        <span>Web development, Seomaniak Agency</span>
        <span>Technologies: Php, javascript(jquery - ajax), html,css</span><br></br>
        <div className="exp-text">
        <span>- Online Medical schedule</span>
        <span>- Digital health record</span>
        <span>- Personal space and a calender for each doctor  </span>
        </div>
      </div>
    
    </div>
    </div>
  );
};

export default Experience;
